import React from "react";
import { NavLink } from "react-router-dom";

function LogInNavBar() {
  const navClass =
    "flex justify-between items-center bg-gray-900 p-4 text-white";

  const linkClass = "text-lg font-bold hover:text-gray-300"; // Define link styling

  return (
    <div>
      <p>SaleSight</p>
      <NavLink to="/about">About</NavLink>
      {/* sign up and about will be in the main nav bar on login page. */}
      <NavLink to="/login">Login</NavLink>
    </div>
  );
}


export default LogInNavBar;
